import Hero from '../components/Hero';
import NavBar from '../components/NavBar';

export default function Home(){
    return(
        <>
            <NavBar/>
            <h1>This is Home</h1>
            <Hero/>
            <div className='hero-text'>
                <h1>Your Jorney Your Story</h1>
                <p>Choose Your Favourite Destination</p>  
            </div>
        </>
    );
}
